import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="container my-2">
      <div className="row justify-content-center">
        <div className="col-11 bg-success Contact">
          <p>PRS Hospital Pvt.Ltd, Killipalam,</p>
          <p>Trivandrum-695002. Kerala, India.</p>

          <p>Tel : +91 471 2344443 / 4073333</p>

          <p>E-mail: admin@prshospital.com</p>
        </div>
      </div>
    </div>
  );
}

export default Contact;
